import base64
from pydub import AudioSegment
from pydub.playback import play

def webm_to_wav(input_file_path, output_file_path):
    try:
        # Load WebM audio using pydub
        audio = AudioSegment.from_file(input_file_path, format="webm")

        # Export audio to WAV file
        audio.export(output_file_path, format="wav")

        print(f'Successfully converted WebM to WAV. Output saved to: {output_file_path}')

    except Exception as e:
        print(f'Error: {e}')

def base64_to_webm(base64_text, output_file_path):
    try:
        # Add padding to the Base64 string if needed
        padding = len(base64_text) % 4
        if padding:
            base64_text += '=' * (4 - padding)

        # Decode Base64 to binary data
        webm_data = base64.b64decode(base64_text)

        # Write binary data to a WebM file
        with open(output_file_path, 'wb') as output_file:
            output_file.write(webm_data)

        print(f'Successfully converted Base64 to WebM. Output saved to: {output_file_path}')
        webm_to_wav(output_file_path, "C:/Users/varad/OneDrive/Desktop/projects/vibrant-hackathon/web/test-gcbc/public/test/output.wav")

    except Exception as e:
        print(f'Error: {e}')

